lt;h2&gt; Duration: 2hr 2m &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 3401 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 94m 15s &lt;/li&gt;\n&lt;li&gt; deserialize time: 960.55 ms &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://131.225.189.99:10078 &lt;/li&gt;\n          &lt;li&gt; Workers: 1 &lt;/li&gt;\n          &lt;li&gt; Threads: 1 &lt;/li&gt;\n          &lt;li&gt; Memory: 7.45 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2023.3.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2023.3.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom distributed import Client\nfrom lpcjobqueue import LPCCondorCluster\n\nfrom dask.distributed import performance_report\nfrom dask_jobqueue import HTCondorCluster, SLURMCluster\n\nfrom processors import CalibrationProcessor\nimport os, sys, subprocess\nimport uproot\nfrom coffea import processor, util\nfrom coffea.nanoevents import NanoEventsFactory, ScoutingNanoAODSchema\n\nimport json\nfrom datetime import datetime\n\nenv_extra = [\n    f\"export PYTHONPATH=$PYTHONPATH:{os.getcwd()}\",\n]\n\ncluster = LPCCondorCluster(\n    transfer_input_files=[\"processors\",\"data\"],\n    ship_env=True,\n    memory=\"8GB\",\n    image=\"coffeateam/coffea-dask:0.7.21-fastjet-3.4.0.1-ge327427\"\n)\n\ncluster.adapt(minimum=1, maximum=250)\nwith Client(cluster) as client:\n\n    print(datetime.now())\n    print(\"Waiting for at least one worker...\")\n    client.wait_for_workers(1)\n    print(datetime.now())\n    \n    with performance_report(filename=\"dask-report.html\"):\n        \n        infiles = subprocess.getoutput(\"ls inputfiles/Run3Summer22EE/*short.json\").split()\n        \n        for this_file in infiles:\n\n            index = this_file.split(\".json\")[0]\n            outfile =
